/**
 * Component dependencies
 */
const React = require('react');
const PropTypes = require('prop-types');

/**
 * Form
 */
const Form = ({
  children,
  ...props
}) => <form {...props}>{children}</form>;

/**
 * Prop types
 */
Form.propTypes = {
  children: PropTypes.node.isRequired,
};

/**
 * Export Form
 */
module.exports = Form;
